)
    COMMENT 'This procedure is used to get all the api and their details on the basis of api group name and country code and operator.'
BEGIN
	/*
		----------------------------------------------------------------------------------------------------------------
		Description	:  This procedure is used to get all the api and their details on the basis of api group name and country code and operator.
		Created On  :  12/5/2017
		Created By	:  Nimisha Mittal
        Modified On :20/11/2018 
        Chenged Description	:  Added new parameters
		----------------------------------------------------------------------------------------------------------------
		Inputs		:   IN `in_api_group_id` TEXT,
						IN in_country_code TEXT,
                        IN `in_operator` TEXT
		Output		:		
		-----------------------------------------------------------------------------------------------------------------
