    SET in_operator=trim(in_operator) ;
	
    -- Split comma seperated country code to rows
    DROP TEMPORARY TABLE IF EXISTS temp_country_codes;
	CALL `gmonstar_utility_string_split`(in_country_code);
	CREATE TEMPORARY TABLE temp_country_codes(id int not null auto_increment,name TEXT,primary key(id));
    

    -- Split comma seperated api group name to rows
	DROP TEMPORARY TABLE IF EXISTS temp_api_group_name;
	CALL `gmonstar_utility_string_split`(in_api_group_name);
	CREATE TEMPORARY TABLE temp_api_group_name(id int not null auto_increment,name TEXT,primary key(id));
  

	-- Split comma seperated operator to rows
    DROP TEMPORARY TABLE IF EXISTS temp_operator;
	CALL `gmonstar_utility_string_split`(in_operator);
	CREATE TEMPORARY TABLE temp_operator(id int not null auto_increment,name TEXT,primary key(id));

	-- get node address and authorization parameters 
    DROP TEMPORARY TABLE IF EXISTS temp_node_id;
    create temporary table temp_node_id
	SELECT 
		node_address.id,node_address.node_id,node_address.host_address,
		node_address.country_code as country_code_id ,node_address.operator as operator_id,node_address.platform_id,node_address.token_response,
		node_address.token_template,operator.name as operator,country.country_code as country_code,
		GROUP_CONCAT(case when authorization_parameters.name is null or authorization_parameters.name ='' then 'null' else authorization_parameters.name end) as authorization_parameters_name,
		GROUP_CONCAT(case when authorization_parameters.regex is null or authorization_parameters.regex ='' then 'null' else authorization_parameters.regex end) as authorization_parameters_regex,
		GROUP_CONCAT(case when authorization_parameters.datatype is null or authorization_parameters.datatype ='' then 'null' else authorization_parameters.datatype end) as authorization_parameters_data_type,
		GROUP_CONCAT(case when authorization_type.type is null or authorization_type.type ='' then 'null' else authorization_type.type end) as authorization_type,
		GROUP_CONCAT(case when node_address_auth_parameter.is_header is null or node_address_auth_parameter.is_header ='' then 'null' else node_address_auth_parameter.is_header end) as authorization_parameters_is_header,
		GROUP_CONCAT(case when node_address_auth_parameter.is_query is null or node_address_auth_parameter.is_query ='' then 'null' else node_address_auth_parameter.is_query end) as authorization_parameters_is_query,
		GROUP_CONCAT(case when node_address_auth_parameter.is_path is null or node_address_auth_parameter.is_path ='' then 'null' else node_address_auth_parameter.is_path end) as authorization_parameters_is_path,
		GROUP_CONCAT(case when node_address_auth_parameter.value is null or node_address_auth_parameter.value ='' then 'null' else node_address_auth_parameter.value end) as authorization_parameters_value,
		GROUP_CONCAT(case when node_address_auth_parameter.is_body is null or node_address_auth_parameter.is_body ='' then 'null' else node_address_auth_parameter.is_body end) as authorization_parameters_is_body
		,node_address.protocol,
		node_address.is_certificate_required,
		node_address.certificate_path
    FROM node_address
	LEFT JOIN `node_address_auth_parameter` ON `node_address_auth_parameter`.`node_address_id` = `node_address`.`id`
	LEFT JOIN `authorization_parameters` ON `authorization_parameters`.`id` = `node_address_auth_parameter`.`auth_parameter_id`
	LEFT JOIN `authorization_type` ON `authorization_parameters`.`authorization_type_id` = `authorization_type`.`id`
	inner join operator on operator.id =node_address.operator
    inner join country on country.id=node_address.country_code
	group by node_address.node_id,node_address.country_code,node_address.operator ;
	
    -- Get api group id on the basis of group name and platform 
	DROP TEMPORARY TABLE IF EXISTS temp_api_group_id;
    create temporary table temp_api_group_id
	SELECT id as api_group_id
    FROM api_group 
    where name in (select name from temp_api_group_name order by temp_api_group_name.id)
	and platform_id in (select platform_id from temp_node_id)  ;

