		temp_operator.name as temp_oper_id,temp_country_codes.name as temp_country_name,	temp_api_group_name.name as temp_api_group_name,
		api_group.id as api_group_id,	api.id as api_id,	temp_node_id.host_address,api.node_id,
		temp_node_id.id as node_address_id,temp_node_id.operator as temp_oper_name,authorization_parameters_name,
