	group by api_group_id,api_id order by temp_api_group_name.id ;
	
    -- get the first groups id
	set @temp_first_api_group_id:=(select api_group_id from temp_country_operator_group limit 1);
	-- Get last sequence if api of first group
    set @temp_last_sequence_id:=(select max(sequence) from api_api_group where api_group_id=@temp_first_api_group_id);

