			`api_api_group_api_group_id` as api_group_id,api_group_type AS `api_group_type`,	api_group_name AS `api_group_name`,
			`api_api_group_api_id` as api_id,api_name,api_url ,
			CASE WHEN vw_api_details.api_group_id!=@temp_first_api_group_id then @temp_last_sequence_id+api_sequence else api_sequence end as api_sequence,
