			api_is_token_required as api_is_token_required,api_max_retires as api_max_retires ,api_retry_interval as api_retry_interval,
			api_timeout as api_timeout , api_time_interval as api_time_interval,min(api_node_id) as api_node_id,error_code_key, error_code_description,
			GROUP_CONCAT(api_input_parameters_api_id) as input_parameters_api_id,
			GROUP_CONCAT(api_input_parameters_name ) as input_parameters_name ,
			GROUP_CONCAT(case when inherit_data_type is null or inherit_data_type ='' then 'null' else inherit_data_type end) as input_parameters_data_type,
			GROUP_CONCAT(case when inherit_length is null or inherit_length ='' then 'null' else inherit_length end SEPARATOR '#$#' ) as input_parameters_length,
			GROUP_CONCAT(case when inherit_regex is null or inherit_regex ='' then 'null' else inherit_regex end SEPARATOR '#$#') as input_parameters_regex ,
			GROUP_CONCAT(case when inherit_regex_description is null or inherit_regex_description ='' then 'null' else inherit_regex_description end SEPARATOR '#$#') as input_parameters_regex_description ,
			GROUP_CONCAT(case when inherit_client_parameter is null or inherit_client_parameter ='' then 'null' else inherit_client_parameter end) as input_parameters_client_parameter, 
			GROUP_CONCAT(case when inherit_client_parameter_value is null or inherit_client_parameter_value ='' then 'null' else inherit_client_parameter_value end) as input_parameters_client_parameter_value, 
			GROUP_CONCAT(case when inherit_input_api_response_parameter_id is null or inherit_input_api_response_parameter_id ='' then 'null' else inherit_input_api_response_parameter_id end) as input_parameters_response_parameter_id, 
			GROUP_CONCAT(case when inherit_is_required is null  then 'null' else inherit_is_required end) as input_parameters_is_required,
			GROUP_CONCAT(case when inherit_is_query is null  then 'null' else inherit_is_query end) as input_parameters_is_query,
         GROUP_CONCAT(case when inherit_is_header is null then 'null' else inherit_is_header end) as input_parameter_is_header,
         GROUP_CONCAT(case when inherit_is_body is null  then 'null' else inherit_is_body end) as input_parameters_is_body,
			GROUP_CONCAT(case when inherit_is_path is null  then 'null' else inherit_is_path end) as input_parameters_is_path,
			GROUP_CONCAT(case when inherit_api_response_parameters_id_id is null or inherit_api_response_parameters_id_id ='' then 'null' else inherit_api_response_parameters_id_id end) as api_response_parameter_id, 
			GROUP_CONCAT(case when api_response_parameters_api_id is null or api_response_parameters_api_id ='' then 'null' else api_response_parameters_api_id end) as response_parameter_api_id, 
			GROUP_CONCAT(case when api_response_parameters_name is null or api_response_parameters_name ='' then 'null' else api_response_parameters_name end) as response_parameter_name,
			GROUP_CONCAT(case when respose_api_name is null or respose_api_name ='' then 'null' else respose_api_name end) as respose_api_name,
			GROUP_CONCAT(case when response_api_url is null or response_api_url ='' then 'null' else response_api_url end) as response_api_url,
			GROUP_CONCAT(case when CONCAT('#&#',api_response_parameters_name,'#&#',api_response_parameters_api_id,'#&#',api_response_parameters_api_group_id) is null or 
			CONCAT('#&#',api_response_parameters_name,'#&#',api_response_parameters_api_id,'#&#',api_response_parameters_api_group_id) ='' then 'null' else 
			CONCAT('#$#',api_response_parameters_name,'#&#',api_response_parameters_api_id,'#&#',api_response_parameters_api_group_id) end) as api_response_parameter_value  ,      
			GROUP_CONCAT(distinct(inherit_api_template)) as  api_template,
			`node_address_id`,`node_address_node_id`,`host_address` as api_host_address,`country_code` as node_address_country_code,
			`operator` as operator_id,	`platform_id` as node_address_platform_id,
			`token_response`,`token_template` as token_api_template,`api_token_api`  as api_token_api,`authorization_type_id`,`node_name`,`platform_name`,`platform_code`,`node_address_operator`,`operator_code`,
			token_api_method_type,
			GROUP_CONCAT(case when is_prefix is null  then 'null' else is_prefix end) as input_parameters_is_prefix,
			GROUP_CONCAT(case when prefix_value is null  then 'null' else prefix_value end) as input_parameters_prefix_value,
			GROUP_CONCAT(case when is_suffix is null  then 'null' else is_suffix end) as input_parameters_is_suffix,
			GROUP_CONCAT(case when suffix_value is null  then 'null' else suffix_value end) as input_parameters_suffix_value
			FROM
			vw_api_details
			where `api_api_group_api_group_id` in (select * from temp_api_group_id)
			group by `api_api_group_api_group_id`,api_api_group_api_id,operator,country_code order by api_sequence;

	  -- Get the Resultant
		select 
			temp_api_detials.*,authorization_parameters_name,authorization_parameters_regex,
			authorization_parameters_data_type,authorization_parameters_is_header, 	authorization_parameters_is_query,
			authorization_parameters_is_path, authorization_parameters_value,authorization_parameters_is_body,
			protocol,is_certificate_required,certificate_path
		from temp_api_detials 
		inner join  temp_country_operator_group
		on temp_api_detials.api_group_id=temp_country_operator_group.api_group_id
		and  temp_api_detials.api_id=temp_country_operator_group.api_id
		and  temp_country_operator_group.temp_oper_name=temp_api_detials.node_address_operator
		and temp_country_operator_group.temp_country_name =temp_api_detials.node_address_country_code order by  api_sequence ;
end//
DELIMITER ;

