DELIMITER //
CREATE  PROCEDURE `gmonstar_audit_log_get_by_token`(
	IN `in_token` VARCHAR(256), 
	IN `in_start_time` INT(16),
	IN `in_end_time` INT(16)
)
    COMMENT 'This procedure is used to get audit log and audit log details on the basis of token.'
BEGIN
	/*
	----------------------------------------------------------------------------------------------------------------
	Description	:   This procedure is used to get audit log and audit log details on the basis of token.
	Created On  :   20/4/2017
    Created By	:	Nimisha Mittal
	----------------------------------------------------------------------------------------------------------------
	Inputs		: IN in_token VARCHAR(256),
				  IN in_start_time INT(16),
				  IN in_end_time INT(16)
   Output		: Returns msg 
	-----------------------------------------------------------------------------------------------------------------
	*/
	-- declare temporary variable of to store the value of api id and api group id of input token.
    DECLARE temp_api_id INT(16);
    DECLARE temp_api_group_id INT(16);
	
	  -- if start time is less then end time then passed dates are in correct sequence else dates are not in correct sequence
	 IF(SELECT in_start_time<in_end_time ) = 1 THEN 
		SET temp_api_id =(SELECT api_id FROM token_management WHERE token=in_token limit 1);
		SET temp_api_group_id =(SELECT api_group_id FROM token_management WHERE token=in_token limit 1);

		SET SESSION group_concat_max_len = 1000000;
		set @query_case:=NULL;
		set @query:=NULL;		  
		
		-- temperory table to store audit log in between start time and end time and for temp api id and temp api group id.
		DROP TEMPORARY TABLE IF EXISTS temp_audit_log;
		CREATE TEMPORARY TABLE temp_audit_log
		SELECT * FROM audit_log
		WHERE log_time BETWEEN in_start_time AND in_end_time AND
		api_group_id=temp_api_group_id AND api_id=temp_api_id;
		
		-- temperory table to store audit log details for audit log id that lies in temp audit log table and in between start time and end time .
		DROP TEMPORARY TABLE IF EXISTS temp_audit_log_details;
		CREATE TEMPORARY TABLE temp_audit_log_details
		SELECT * FROM audit_log_details
		WHERE log_time BETWEEN in_start_time AND in_end_time AND	
		audit_log_id in (select id from temp_audit_log) ;
						
		-- query to create cases
		set @query_case:=(
		select 
		group_concat(distinct( concat("max(case when name='",name,"'"," then "," value "," else null end) as `",name,"`") ))
		from  temp_audit_log_details WHERE temp_audit_log_details.name not in ('tracking_message_header','audit_log_id','message')
		);
		
		IF(SELECT @query_case IS NULL) THEN 
			SELECT 'Data is not available' as msg;
		ELSE
			set @query:=(select
				concat(" select temp_audit_log_details.tracking_message_header,temp_audit_log_details.audit_log_id,
							temp_audit_log.message ,",
							@query_case,
					
				"		from temp_audit_log_details ",
				" inner join temp_audit_log on 
					temp_audit_log_details.tracking_message_header=temp_audit_log.tracking_message_header and 
					temp_audit_log_details.audit_log_id=temp_audit_log.id ",
				" group by temp_audit_log_details.tracking_message_header,temp_audit_log_details.audit_log_id;")
				
				);
			prepare stmt1 from @query;
			execute stmt1;
			deallocate prepare stmt1;
		END IF;
	ELSE
		SELECT 'Date format is not correct' as msg;
	END IF;
END//
DELIMITER ;

