DELIMITER //
CREATE  PROCEDURE `gmonstar_audit_log_get_by_tracking_message`(
	IN in_tracking_message_header  VARCHAR(256)
)
    COMMENT 'This procedure is used to get audit log and audit log details of by tracking message header.'
BEGIN
	/*
		----------------------------------------------------------------------------------------------------------------
		Description	:   This procedure is used to get audit log and audit log details by tracking message header.
		Created On  :   20/4/2017
		Created By	:	Nimisha Mittal
        Modified On :   07/02/2019
        Changed Description: Added logtype
		----------------------------------------------------------------------------------------------------------------
		Inputs		:   IN `in_tracking_message_header` INT(16) ------ Unique tracking message header
	    Output		:	Returns msg 
		-----------------------------------------------------------------------------------------------------------------
	*/
	-- set the length of group concat
	SET SESSION group_concat_max_len = 1000000;
	set @query_case:=NULL;
	set @query:=NULL;		  
    
	-- temporary table to store audit log on the basis of passed tracking message header
    DROP TEMPORARY TABLE IF EXISTS temp_audit_log;
	CREATE TEMPORARY TABLE temp_audit_log
	SELECT 
		audit_log.id  as id,audit_log.api_group_id ,audit_log.api_id ,audit_log.tracking_message_header ,audit_log.log_time ,
		audit_log.is_successful , audit_log.message , audit_log.state_id ,audit_log.user_id,
        api.name as api_name,api_method_type.type as api_type ,
        (case when audit_log.is_successful=0 then 'Exception' else 'Log' end ) as log_type
	FROM audit_log
    left join api on api.id=audit_log.api_id
    left join api_method_type on api.method_type_id=api_method_type.id
	WHERE tracking_message_header=in_tracking_message_header;
    

    -- temporary table to store audit log details on the basis of audir log id lies in temp audit log table.
	DROP TEMPORARY TABLE IF EXISTS temp_audit_log_details;
	CREATE TEMPORARY TABLE temp_audit_log_details
	SELECT * FROM audit_log_details
	WHERE 	audit_log_id in (select id from temp_audit_log) ;
	
    -- temporary table to store state data
	DROP TEMPORARY TABLE IF EXISTS temp_state;
	CREATE TEMPORARY TABLE temp_state
	SELECT id as id,name as state_name FROM state;
   
    -- query to create cases
	set @query_case:=(
						select 
						group_concat(distinct( concat("max(case when name='",name,"'"," then "," value "," else null end) as `",name,"`") ))
						from  temp_audit_log_details WHERE temp_audit_log_details.name not in ('tracking_message_header','audit_log_id','message')
					 );

	-- if @query case is is null then data is not available else create dynamic query @query
	IF(SELECT @query_case IS NULL) THEN 	
		SELECT 'Data is not available' as msg;

	ELSE	
		set @query:=(select
						concat(" select temp_audit_log_details.tracking_message_header,temp_audit_log_details.audit_log_id,
							temp_audit_log.message ,temp_audit_log.state_id as state_id ,temp_state.state_name,temp_audit_log.log_time as start_time,
                           temp_audit_log.api_name as api_name,temp_audit_log.api_type as api_type,log_type,",
							@query_case,
				"		from temp_audit_log_details ",
				" inner join temp_audit_log on 
					temp_audit_log_details.tracking_message_header=temp_audit_log.tracking_message_header and 
					temp_audit_log_details.audit_log_id=temp_audit_log.id
                    inner join temp_state on temp_state.id=temp_audit_log.state_id
                    ",
				" group by temp_audit_log_details.tracking_message_header,temp_audit_log_details.audit_log_id
                order by temp_audit_log.log_time asc;"
				) );
		prepare stmt1 from @query;
		execute stmt1;
		deallocate prepare stmt1;
	END IF;
END//
DELIMITER ;

