-- Dumping structure for procedure gmonstar_orchestration.gmonstar_audit_log_insert
DROP PROCEDURE IF EXISTS `gmonstar_audit_log_insert`;
DELIMITER //
CREATE  PROCEDURE `gmonstar_audit_log_insert`(
		IN in_tracking_message_header VARCHAR(256),
		IN in_api_group_id text ,
		IN in_api_id text ,
		IN in_is_successful tinyint(1) ,
        IN in_message varchar(256) ,
		IN in_state_id int(16),
        IN in_name TEXT ,
		IN in_value TEXT ,
        IN in_username varchar(256)
)
    COMMENT 'This procedure is used to insert audit log and audit log details of api.'
BEGIN
	/*
	----------------------------------------------------------------------------------------------------------------
	Description	:  This procedure is used to insert audit log and audit log details of api.
	Created On  :   11/4/2017
    Created By	:	Nimisha Mittal
	----------------------------------------------------------------------------------------------------------------
	Inputs	:   	IN in_tracking_message_header VARCHAR(256),
					IN in_api_group_id int(16) ,
					IN in_api_id int(16) ,
					IN in_is_successful tinyint(1) ,
					IN in_message varchar(256) ,
					IN in_state_id int(16),
					IN in_name TEXT ,
					IN in_value TEXT 
					IN in_username varchar(256)      
	Output	:		Returns msg 
   
	Modified On	:	26 Oct 2018
	Modified By	:	Saurabh kumar
	Modification:	Added logic of localization
	-----------------------------------------------------------------------------------------------------------------
	*/
	-- temporary used for localization concept
	DECLARE catchAribitrary BOOLEAN; 
	DECLARE in_lang_code INT ;
	DECLARE temp_default_lang_code INT;
	DECLARE temp_lang_code INT ;

	-- declare temp audit log id varaiable to store auto increment id of audit log .
	DECLARE temp_log_time INT(16);
	DECLARE temp_audit_log_id INT(16);
	DECLARE temp_user_id int ;
	
	-- setting the value of localization variables
	SET in_lang_code=null;
	SET temp_default_lang_code=(SELECT code FROM language WHERE is_default=1);
	SET temp_lang_code=(SELECT COALESCE(in_lang_code , temp_default_lang_code));
	SET temp_user_id=(select id from users where username=in_username limit 1);

	SET temp_log_time = (SELECT UNIX_TIMESTAMP());

	set @temp_api_group_id:= (select substring_index(in_api_group_id,'|#@|',1));
    set @temp_api_id:= (select substring_index(in_api_id,'|#@|',1));
	-- insert passed parameters into audit log table.
			api_group_id ,
			api_id ,
			tracking_message_header ,
			log_time,
			is_successful ,
			message ,
			state_id ,
			user_id 
		)
	 values
			(
				@temp_api_group_id ,
				@temp_api_id ,
				in_tracking_message_header ,
				temp_log_time,
				in_is_successful ,
				in_message ,
				in_state_id ,
				temp_user_id

			);
	SET temp_audit_log_id = (SELECT id FROM audit_log WHERE tracking_message_header=in_tracking_message_header ORDER BY id DESC LIMIT 1 );
    -- split the comma seperated values as rows and inserted into temporary table
    DROP TEMPORARY TABLE IF EXISTS temp_log_name;
	CALL `gmonstar_utility_string_split`(in_name);
    CREATE TEMPORARY TABLE temp_log_name(id int not null auto_increment,name TEXT,primary key(id));

	-- split the comma seperated values as rows and inserted into temporary table
	DROP TEMPORARY TABLE IF EXISTS temp_log_value;
	CALL `gmonstar_utility_string_split`(in_value);
	CREATE TEMPORARY TABLE temp_log_value(id int not null auto_increment,value text,primary key(id));
    
	-- insert data into audit log details
			audit_log_id   ,
			api_group_id   ,
			api_id  ,
			tracking_message_header   ,
			name   ,
			value  ,
			log_time,
			user_id
			
	)
    
    SELECT 
			temp_audit_log_id   ,
			@temp_api_group_id ,
			@temp_api_id ,
			in_tracking_message_header   ,
			temp_log_name.name   ,
			temp_log_value.value  ,
			temp_log_time  ,
            temp_user_id
	FROM temp_log_name INNER JOIN temp_log_value on temp_log_name.id=temp_log_value.id;
		-- Get Message From messages table
	SET @catchArbitrary=(SELECT gmonstar_message_by_parameter_and_langauge_code("isAuditLogInserted",1,temp_lang_code));			
	SELECT @msg AS msg,@temp_api_group_id as api_group_id, @temp_api_id as api_id;
END//
DELIMITER ;

