	/*
		----------------------------------------------------------------------------------------------------------------
		Description	:  This procedure is used to check weather user is valid or not on the basis of username and password.
		Created On  :   12/4/2017
		Created By	:	Nimisha Mittal
		----------------------------------------------------------------------------------------------------------------
		Inputs	:   	IN in_username VARCHAR(256),
						IN in_password VARCHAR(256),
						IN in_ip VARCHAR(256)
		Output	:		1 if user is valid else 0 as user is not valid
		----------------------------------------------------------------------------------------------------------------
	*/
	-- This procedure is used to check weather user is valid or not on the basis of username and password
	/*
	if temp password key and temp encrypt password as same the user is valid else not valid
	*/

