	IF(temp_password=temp_encrypt_password) >0 THEN 
		SELECT 'User is valid' as msg ,(SELECT token FROM users WHERE username=in_username) as token, 1 as is_valid;
	else
        SELECT 'User is not valid' as msg ,0 as is_valid;
	END IF;
