-- Dumping structure for procedure gmonstar_orchestration.gmonstar_remove_regex_country_code
DROP PROCEDURE IF EXISTS `gmonstar_remove_regex_country_code`;
DELIMITER //
CREATE  PROCEDURE `gmonstar_remove_regex_country_code`(
IN `in_country_code` TEXT
)
    COMMENT 'This procedure is used to remove regex for existing country code.'
BEGIN
	/*
		----------------------------------------------------------------------------------------------------------------
		Description	:   This procedure is used to remove regex for existing country code.
		Created On  :   27/12/2017
		Created By	:	Nimisha Mittal
		----------------------------------------------------------------------------------------------------------------
		Inputs		:  IN in_country_code TEXT
		Output		:		
		-----------------------------------------------------------------------------------------------------------------
	*/
		DECLARE temp_country_code VARCHAR(256);
		-- replace the , with |#@|
		SET in_country_code=replace(in_country_code,',','|#@|');
		-- replace the , with |#@| and get the existing regex of country code
		SET temp_country_code=(SELECT replace(regex,'|','|#@|') FROM api_input_parameters where client_parameter='countryCode' limit 1);

		-- To split existing country code
	    DROP TEMPORARY TABLE IF EXISTS temp_existing_country_code;
		CALL `gmonstar_utility_string_split`(temp_country_code);
		CREATE TEMPORARY TABLE temp_existing_country_code(id int not null auto_increment,name TEXT,primary key(id));

		-- To split new country code
		DROP TEMPORARY TABLE IF EXISTS temp_new_country_code;
		CALL `gmonstar_utility_string_split`(in_country_code);
		CREATE TEMPORARY TABLE temp_new_country_code(id int not null auto_increment,value text,primary key(id));
		
        -- Remove the existing the country code
		DROP TEMPORARY TABLE IF EXISTS temp_distinct_country_code;
		CREATE TEMPORARY TABLE temp_distinct_country_code
		SELECT temp_existing_country_code.name from temp_existing_country_code where temp_existing_country_code.name not in (
		SELECT value FROM temp_new_country_code);
		
		UPDATE api_input_parameters
			set regex=(SELECT GROUP_CONCAT(name SEPARATOR '|') FROM temp_distinct_country_code)
			where client_parameter='countryCode';
		SELECT 'Regex is removed and updated.' as msg;
END//
DELIMITER ;

