-- Dumping structure for procedure gmonstar_orchestration.gmonstar_token_get
DROP PROCEDURE IF EXISTS `gmonstar_token_get`;
DELIMITER //
CREATE  PROCEDURE `gmonstar_token_get`(
	IN in_api_group_id INT(16),
    IN in_api_id INT(16),
    IN in_node_address_id INT(16)
)
    COMMENT 'This procedure is used to get token by api group id and api id and node address id'
BEGIN
	/*
	----------------------------------------------------------------------------------------------------------------
	Description	:  This procedure is used to get token by api group id and api id and node address id
	Created On  :   7/4/2017
    Created By	:	Nimisha Mittal
	----------------------------------------------------------------------------------------------------------------
	Inputs		:   IN in_api_group_id INT(16),
					IN in_api_id INT(16),
					IN in_node_address_id INT(16)
    Output		:	0 as token status -- token need to insert
					1 as token status -- token is valid but expired
                    2 as token status -- token is valid
	-----------------------------------------------------------------------------------------------------------------
	*/
	/*
	if token for the api id and api group id is null then need to insert token first and return token status as 0
	else if valid till time is less then current time then token is valid but expired then return all the details of token with token status as 1
	else token is not expired then return all the details of token with token status 2.
	*/
	DECLARE temp_time_interval INT(16);
    DECLARE temp_host_address varchar(512);
    
	-- get the time interval of api
	SET temp_time_interval = (SELECT time_interval FROM api WHERE  id=in_api_id);
    -- get host address of api
	SET temp_host_address=(SELECT host_address from node_address where id=in_node_address_id );
	
	-- get all host address id on the basis of temp host address
    DROP TEMPORARY TABLE IF EXISTS temp_host_address_id;
	CREATE TEMPORARY TABLE IF NOT EXISTS temp_host_address_id
	SELECT token_management.id,api_group_id,api_id,token,creation_time,last_modified_time,valid_till,is_active,node_address_id 
    FROM token_management
    inner join  node_address on node_address.id=token_management.node_address_id
    where host_address=temp_host_address ;
	

    IF (SELECT COUNT(token) FROM temp_host_address_id where is_active=1 )=0 THEN
		SELECT 'Please insert token first' as msg,0 as token_status;
	ELSEIF(SELECT COUNT(token) FROM temp_host_address_id WHERE  is_active=1 AND UNIX_TIMESTAMP()>valid_till) >0 THEN 
        SELECT 
				id ,
				api_group_id ,
				api_id , 
				token ,
				creation_time , 
				last_modified_time ,
				temp_time_interval as api_time_interval,
				valid_till ,
				is_active ,
				'1' as token_status
		FROM temp_host_address_id WHERE  is_active=1 ;
	ELSE
		SELECT 
				id ,
				api_group_id ,
				api_id , 
				token ,
				creation_time , 
				last_modified_time ,
				temp_time_interval as api_time_interval ,
				valid_till ,
				is_active ,
				'2' as token_status 
		FROM temp_host_address_id WHERE  is_active=1;
	END IF;
END//
DELIMITER ;

-- Dumping structure for procedure gmonstar_orchestration.gmonstar_token_insert
DROP PROCEDURE IF EXISTS `gmonstar_token_insert`;
DELIMITER //
CREATE  PROCEDURE `gmonstar_token_insert`(
	IN in_api_group_id INT(16),
    IN in_api_id INT(16),
    IN in_token VARCHAR(256),
    IN in_node_address_id INT(16)
)
    COMMENT 'This procedure is used to insert token for passed api id and api group id.'
BEGIN
	/*
	----------------------------------------------------------------------------------------------------------------
	Description	:   This procedure is used to insert token for passed api id and api group id.
	Created On  :   7/4/2017
    Created By	:	Nimisha Mittal
	----------------------------------------------------------------------------------------------------------------
	Inputs		:  IN in_api_group_id INT(16),
					IN in_api_id INT(16),
					IN in_token VARCHAR(256)
					IN in_node_address_id INT(16)
   Output		:	Returns msg 
	-----------------------------------------------------------------------------------------------------------------
	*/

	/*
	declare temp time variable to store the current time and temp time interval variable to store the interval for the api group id and api id.
	if token managemnet table consists a active token for a node adress id then first inactive that token for the node address id
	then insert new token for the node address with increased valid till time for the token else 
	if token already exists in token management table then token already exists else insert token for api group id and api id .
	*/

	DECLARE temp_time INT(16);
	DECLARE temp_time_interval INT(16);
    DECLARE temp_host_address varchar(512);

	SET temp_time = (SELECT UNIX_TIMESTAMP());
	SET temp_time_interval =(SELECT time_interval FROM api WHERE id=in_api_id );

	SET temp_host_address=(SELECT host_address from node_address where id=in_node_address_id );

	DROP TEMPORARY TABLE IF EXISTS temp_host_address_id;
	CREATE TEMPORARY TABLE IF NOT EXISTS temp_host_address_id
	SELECT * FROM node_address where host_address=temp_host_address;

	IF(SELECT COUNT(id) FROM token_management WHERE in_node_address_id in (SELECT id FROM temp_host_address_id ))>0 THEN 
		UPDATE token_management
		SET is_active=0
		 WHERE node_address_id in (SELECT id FROM temp_host_address_id );

			api_group_id,
			api_id , 
			token ,
			creation_time , 
			last_modified_time ,
			valid_till ,
			is_active ,
			node_address_id
		 )
		VALUES
		(
			in_api_group_id,
			in_api_id,
			in_token,
			temp_time,
			temp_time,
			(temp_time+(temp_time_interval*60)),
			1,
			in_node_address_id
		);
		SELECT 'Token is inserted',in_api_id as api_id,in_api_group_id as api_group_id,in_node_address_id as node_address_id, in_token as token;
	else
		IF(SELECT COUNT(token) FROM token_management WHERE in_token in (SELECT token from token_management))>0 THEN
			SELECT 'This token already exists!' as msg;
		ELSE

					api_group_id,
					api_id , 
