-- Dumping structure for procedure gmonstar_orchestration.gmonstar_token_update
DROP PROCEDURE IF EXISTS `gmonstar_token_update`;
DELIMITER //
CREATE  PROCEDURE `gmonstar_token_update`(
	IN in_api_group_id INT(16),
    IN in_api_id INT(16),
    IN in_last_modified_time INT(16),
    IN in_token VARCHAR(256),
    IN in_node_address_id INT(16)
)
    COMMENT 'This procedure is used to update token details on the basis of api group id and api id.'
BEGIN
	/*
	----------------------------------------------------------------------------------------------------------------
	Description	:   This procedure is used to update token details on the basis of api group id and api id.
	Created On  :   7/4/2017
    Created By	:	Nimisha Mittal
	----------------------------------------------------------------------------------------------------------------
	Inputs	:   	IN in_api_group_id INT(16),
					IN in_api_id INT(16),
					IN in_last_modified_time INT(16),
					IN in_token VARCHAR(256)
					IN in_node_address_id INT(16)
    Output	:		Returns msg 
	-----------------------------------------------------------------------------------------------------------------
	*/
	-- declare variable temp time interval to store time interval
	DECLARE temp_time_interval INT(16);
	SET temp_time_interval= (SELECT time_interval FROM api WHERE  id=in_api_id  );

	UPDATE token_management
	SET
		token= COALESCE(in_token,token),
		last_modified_time= COALESCE(in_last_modified_time,last_modified_time),
		valid_till= in_last_modified_time+(temp_time_interval*60),
		is_active=0
	WHERE  node_address_id=in_node_address_id  AND is_active=1;
END//
DELIMITER ;

-- Dumping structure for procedure gmonstar_orchestration.gmonstar_update_regex_country_code
DROP PROCEDURE IF EXISTS `gmonstar_update_regex_country_code`;
DELIMITER //
CREATE  PROCEDURE `gmonstar_update_regex_country_code`(
IN `in_country_code` TEXT
)
    COMMENT 'This procedure is used to get update regex for country code.'
BEGIN
	/*
	----------------------------------------------------------------------------------------------------------------
	Description	:  This procedure is used to get update regex for country code.
	Created On  :   27/12/2017
    Created By	:	Nimisha Mittal
	----------------------------------------------------------------------------------------------------------------
	Inputs		:  IN in_country_code TEXT
    Output		:		
	-----------------------------------------------------------------------------------------------------------------
	*/

	DECLARE temp_country_code VARCHAR(256);
	-- replace the , with |#@|
	SET in_country_code=replace(in_country_code,',','|#@|');
	-- replace the , with |#@| and get the existing regex of country code
	SET temp_country_code=(SELECT replace(regex,'|','|#@|') FROM api_input_parameters where client_parameter='countryCode' limit 1);

		-- To split existing country code
		DROP TEMPORARY TABLE IF EXISTS temp_existing_country_code;
		CALL `gmonstar_utility_string_split`(temp_country_code);
		CREATE TEMPORARY TABLE temp_existing_country_code(id int not null auto_increment,name TEXT,primary key(id));

		-- To split new country code
		DROP TEMPORARY TABLE IF EXISTS temp_new_country_code;
		CALL `gmonstar_utility_string_split`(in_country_code);
		CREATE TEMPORARY TABLE temp_new_country_code(id int not null auto_increment,value text,primary key(id));
		
		-- Remove the duplicate country code
		DROP TEMPORARY TABLE IF EXISTS temp_distinct_country_code;
		CREATE TEMPORARY TABLE temp_distinct_country_code
		SELECT * from temp_existing_country_code
		UNION 
		SELECT * FROM temp_new_country_code;
		
		UPDATE api_input_parameters
		set regex=(SELECT GROUP_CONCAT(name SEPARATOR '|') FROM temp_distinct_country_code)
		where client_parameter='countryCode';
			 
		SELECT 'Regex is updated.' as msg;
END//
DELIMITER ;

