	IN `in_password` varchar(256)

)
    COMMENT 'This procedure is used to insert user.'
BEGIN
	/*
		----------------------------------------------------------------------------------------------------------------
		Description	:  This procedure is used to insert user.
		Created On  :  25/09/2018
		Created By	:  Nimisha Mittal
		----------------------------------------------------------------------------------------------------------------
		Inputs		:   	IN `in_username` varchar(256),
							IN `in_password` varchar(256)
		Output		:		
		-----------------------------------------------------------------------------------------------------------------
	*/
	-- get password key
    SET @temp_password_key:=(select uuid());
	-- generate password
	SET @temp_password:=(select gmonstar_password_encode(in_password,@temp_password_key)) ;
    -- Check if user already exists
    if(select count(id) from users where username=in_username) then
		update users 
			set 
			`password`=@temp_password,
			password_key=@temp_password_key
		where username=in_username;
		select 'User is inserted' as msg,1 as is_inserted;
	else
		select 'User is inserted' as msg,1 as is_inserted;
    end if;
END//
