    -- temp table to store the inherit input parameters
	DROP table if exists temp_inherit_input_parameters;
    CREATE TEMPORARY TABLE temp_inherit_input_parameters 
    SELECT inherit_api_input_parameters.*,api_input_parameters.api_id,api_input_parameters.name FROM inherit_api_input_parameters 
    LEFT JOIN api_input_parameters ON inherit_api_input_parameters.api_input_parameters_id = api_input_parameters.id
	where api_api_group_id = in_api_api_group_id;
    
