    DROP temporary table if exists temp_extra_inherit_input_parameters;
    CREATE TEMPORARY TABLE temp_extra_inherit_input_parameters 
    SELECT * FROM temp_inherit_input_parameters 
    WHERE api_input_parameters_id NOT IN (SELECT id FROM api_input_parameters where api_id = in_api_id);
    
    -- count of extra inherit input parameter which are not in api input parameters
    SET @count_extra_inherit_input_parameters = (SELECT count(*) FROM temp_extra_inherit_input_parameters);
    
