    SELECT * FROM api_input_parameters WHERE api_id = in_api_id AND
    id NOT IN (SELECT api_input_parameters_id FROM temp_inherit_input_parameters)
    AND name IN ('user_key','token','requestId','identifier','indentifier_value','returnUrl');
    
    SET @count_required_absent_parameters = (SELECT count(*) FROM temp_api_input_required_absent_parameters);
    
    SET @count_required_wrong_header_inherit_input_parameters = (SELECT count(*) FROM temp_inherit_input_parameters 
															WHERE name IN ('user_key','token','requestId','identifier','indentifier_value','returnUrl')
                                                           AND is_header=0);
	/*
		`api_api_group_id`,
		`api_input_parameters_id`,
		`data_type`,
		`is_header`,
		`length`,
		`regex`,
		`regex_description`,
		`client_parameter`,
		`client_parameter_value`,
